import java.io.*;
import java.nio.charset.StandardCharsets;

import static com.yushang.risk.FileUtils.UtilHelper.base64String2ByteFun;

@Slf4j
public class FileUtils {
  public static void main(String[] args) {
    // byte[] bytes = fileConvertToByteArray(new File("E:\\图片\\3.png"));
    byte[] b =
        base64String2ByteFun(
            "");
    byteToFile(b, "D:\\a.jpg");
  }
  /**
   * @Title: byteToFile @Description: 把二进制数据转成指定后缀名的文件，例如PDF，PNG等
   *
   * @param contents 二进制数据
   * @param filePath 文件存放目录，包括文件名及其后缀，如D:\file\bike.jpg @Author: Wiener @Time: 2018-08-26 08:43:36
   */
  public static void byteToFile(byte[] contents, String filePath) {
    BufferedInputStream bis = null;
    FileOutputStream fos = null;
    BufferedOutputStream output = null;
    try {
      ByteArrayInputStream byteInputStream = new ByteArrayInputStream(contents);
      bis = new BufferedInputStream(byteInputStream);
      File file = new File(filePath);
      // 获取文件的父路径字符串
      File path = file.getParentFile();
      if (!path.exists()) {
        log.info("文件夹不存在，创建。path={}", path);
        boolean isCreated = path.mkdirs();
        if (!isCreated) {
          log.error("创建文件夹失败，path={}", path);
        }
      }
      fos = new FileOutputStream(file);
      // 实例化OutputString 对象
      output = new BufferedOutputStream(fos);
      byte[] buffer = new byte[1024];
      int length = bis.read(buffer);
      while (length != -1) {
        output.write(buffer, 0, length);
        length = bis.read(buffer);
      }
      output.flush();
    } catch (Exception e) {
      log.error("输出文件流时抛异常，filePath={}", filePath, e);
    } finally {
      try {
        bis.close();
        fos.close();
        output.close();
      } catch (IOException e0) {
        log.error("文件处理失败，filePath={}", filePath, e0);
      }
    }
  }

  /**
   * 把一个文件转化为byte字节数组。
   *
   * @return
   */
  private static byte[] fileConvertToByteArray(File file) {
    byte[] data = null;

    try {
      FileInputStream fis = new FileInputStream(file);
      ByteArrayOutputStream baos = new ByteArrayOutputStream();

      int len;
      byte[] buffer = new byte[1024];
      while ((len = fis.read(buffer)) != -1) {
        baos.write(buffer, 0, len);
      }

      data = baos.toByteArray();

      fis.close();
      baos.close();
    } catch (Exception e) {
      e.printStackTrace();
    }

    return data;
  }

  static class UtilHelper {
    @Test
    void test01() {
      byte[] b =
          base64String2ByteFun(
              "data:image/png;base64,");
      System.out.println("b = " + b);
    }

    // base64字符串转byte[]
    public static byte[] base64String2ByteFun(String base64Str) {
      return Base64.decodeBase64(base64Str);
    }
    // byte[]转base64
    public static String byte2Base64StringFun(byte[] b) {
      return Base64.encodeBase64String(b);
    }
  }
}
